Defendant Shade Alline Swayzer in court with attorney Richard J. Johnson.  Defendant Shade Alline Swayzer in custody.  James W. Frisch appeared for the State of Wisconsin.  Sentencing proceeded.  Statements by the State, defense and defendant.    The Court imposed the following sentence:

Defendant's TOTAL LENGTH OF SENTENCE shall be 3 years.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for 1-1/2 years  with credit for 183 days time served.  Defendant shall serve 1-1/2 years on EXTENDED SUPERVISION.  The defendant IS eligible for the Challenge Incarceration Program, but not for the Wisconsin Substance Abuse Program.  The Court advised the defendant of her determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant.  The Court STAYED THE SENTENCE and placed the defendant on probation to the State Department of Corrections for a period of three (3) years.
 * Court ordered defendant to provide a DNA sample.

CONDITIONS OF PROBATION (and Extended Supervision, if revoked):
 - Undergo a mental health evaluation; follow thru with treatment recommended;
 - No contact with Vela M., Aiesha S. or Kahlil M. or their residence;
 - Be supervised by the mental health unit of the Probation Department;
 - Remain controlled substance free, other than those legally prescribed for defendant by a duly licensed physician for her mental or physical needs; take all medications as prescribed and for as long as deemed medically reasonable and necessary;
 - No alcohol;
 - Urine screens;
 - Parenting classes/counseling;
 - Anger management counseling;
 - Seek and maintain employment to the extent possible;
 - Be given job and vocational training;
 - Cognitive thinking intervention counseling;
 - Pay restitution to Vela M. in the stipulated amount of $250.00 first; then pay $296.85 to Wisconsin Mutual Insurance Company; pay the DNA surcharge, costs, surcharges, disbursements and supervision fees.  Should defendant get revoked, Court ordered monies taken from prison funds not to exceed 25%.  Balance to be paid while on extended supervision.  Failure to pay would result in a civil judgment entered against defendant.

